import React, { useEffect, useState } from "react";
import axios from "axios";

const Test = () => {
  const [data, setData] = useState("");
  useEffect(() => {
    axios
      .get("api/hello")
      .then((response) => {
        console.log(response.type);
        setData(response.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  return <div>{data.type}</div>;
};

export default Test;
